(function() {

    const decode = string=>{
        // Going backwards: from bytestream, to percent-encoding, to original string.
        return decodeURIComponent(atob(string).split('').map(c=>'%' + ('00' + c.charCodeAt(0).toString(16)).slice(-2)).join(''));
    }

    const formContainer = document.createElement('div');
    formContainer.innerHTML = decode(``);

    const formWrapper = formContainer.querySelector('[data-form="f674b022-f25f-11eb-96e5-06b4694bee2a"]');

    const style = document.createElement('style');
    style.innerHTML = decode(``);

    const parentScript = document.querySelector('script[data-form="f674b022-f25f-11eb-96e5-06b4694bee2a"]');

    parentScript.parentNode.insertBefore(formContainer.firstElementChild, parentScript.nextSibling);

    parentScript.parentNode.insertBefore(style, parentScript.nextSibling);

    parentScript.remove();

    const messages = {
        success: 'Thanks\u0020for\u0020subscribing\u0021',
        missingEmailAddress: 'Your email address is required.',
        invalidEmailAddress: 'Your email address looks incorrect, please try again.',
        botSubmissionError: 'This doesn\'t look like a human submission.',
        consentRequired: 'Please check the checkbox to indicate your consent.',
        invalidParametersError: 'This form has missing or invalid fields.',
        unknownError: 'Sorry, an unknown error has occurred. Please try again later.',
    };

    const form = document.querySelector('[data-form="f674b022-f25f-11eb-96e5-06b4694bee2a"] form');

    const isBotPost = ()=>{
        const honeypotInput = form.querySelector('.emailoctopus-form-row-hp input');

        return Boolean(honeypotInput.value);
    }
    ;

    const hasEmailAddressBeenEntered = ()=>{
        const emailAddress = form.querySelector('input[type=email]').value.trim();

        return Boolean(emailAddress);
    }
    ;

    const isEmailAddressValid = ()=>{
        const emailAddress = form.querySelector('input[type=email]').value.trim();

        return /\S+@\S+\.\S+/.test(emailAddress);
    }
    ;

    const consentRequired = ()=>{
        if (!false) {
            return false;
        }

        var checkbox = form.querySelector('.emailoctopus-form-row-consent input');

        return Boolean(!checkbox || !checkbox.checked);
    }

    const hasRedirectUrl = ()=>{
        return false;
    }

    const getRedirectUrl = ()=>{
        return "";
    }
    ;

    const showConfirmation = ()=>{
        form.style.display = 'none';

        form.parentNode.querySelector('.emailoctopus-success-message').textContent = messages.success;
    }
    ;

    const submit = async function() {
        form.querySelector('[type=submit]').setAttribute('disabled', 'disabled');

        const formData = Array.from(form.querySelectorAll('input[name]')).reduce((formData,input)=>{
            const name = encodeURIComponent(input.getAttribute('name'));
            const value = encodeURIComponent(input.value);
            const accumulator = formData ? (formData + '&') : '';

            return accumulator + (name + '=' + value);
        }
        , '');

        const response = await (await fetch(form.action, {
            method: 'POST',
            mode: 'cors',
            cache: 'no-cache',
            headers: {
                'Content-Type': 'application/x-www-form-urlencoded'
            },
            body: formData
        })).json();

        if (response.success) {
            onSuccess();
        } else {
            if (response.error && response.error.code) {
                if (response.error.code === 'INVALID_PARAMETERS') {
                    onError(messages.invalidParametersError);
                }

                if (response.error.code === 'BOT_SUBMISSION') {
                    onError(messages.botSubmissionError);
                }
            } else {
                onError(messages.unknownError);
            }
        }
    };

    const onSuccess = response=>{
        if (hasRedirectUrl()) {
            window.top.location.href = getRedirectUrl();
        } else {
            showConfirmation(form, response);
        }
    }
    ;

    const onError = message=>{
        form.parentNode.querySelector('.emailoctopus-error-message').textContent = message;

        form.querySelector('[type=submit]').removeAttribute('disabled');

        if (form.getAttribute('data-widget-id') && window.grecaptcha) {
            window.grecaptcha.reset(form.getAttribute('data-widget-id'));
        }

        var recaptchaResponse = form.querySelector('input[name=g-recaptcha-response]');

        if (recaptchaResponse) {
            recaptchaResponse.remove();
        }
    }
    ;

    window.loadRecaptchaForf674b022f25f11eb96e506b4694bee2a = function() {
        const recaptchaContainer = document.createElement('div');
        form.appendChild(recaptchaContainer);

        form.dataset.recaptchaWidgetId = window.grecaptcha.render(recaptchaContainer, {
            'sitekey': '6LdYsmsUAAAAAPXVTt\u002DovRsPIJ_IVhvYBBhGvRV6',
            'callback': function(token) {
                var recaptchaResponse = document.createElement('input');
                recaptchaResponse.setAttribute('name', 'recaptcha-response');
                recaptchaResponse.setAttribute('type', 'hidden');
                recaptchaResponse.value = token;
                form.appendChild(recaptchaResponse);

                var event = new Event('submit',{
                    'bubbles': true,
                    'cancelable': true
                });

                form.dispatchEvent(event);
            },
            'theme': 'light',
            'size': 'invisible',
            'type': 'image',
            'isolated': true
        }, false);
    }
    ;

    const recaptchaScript = document.createElement('script');
    recaptchaScript.type = 'text/javascript';
    recaptchaScript.src = 'https://www.google.com/recaptcha/api.js?onload=loadRecaptchaForf674b022f25f11eb96e506b4694bee2a&render=explicit';
    recaptchaScript.defer = true;
    recaptchaScript.async = true;
    document.body.appendChild(recaptchaScript);

    form.addEventListener('submit', function(event) {
        if (form.querySelector('[name=recaptcha-response]')) {
            return;
        }

        event.preventDefault();
        event.stopPropagation();
        event.stopImmediatePropagation();

        if (form.reportValidity()) {
            grecaptcha.execute(form.dataset.recaptchaWidgetId);
        }
    });

    form.addEventListener('submit', function(event) {
        if (true && !form.querySelector('[name=g-recaptcha-response]')) {
            return;
        }

        event.preventDefault();
        event.stopPropagation();
        event.stopImmediatePropagation();

        form.parentNode.querySelector('.emailoctopus-error-message').textContent = '';

        if (isBotPost(form)) {
            onError(messages.botSubmissionError);

            return;
        }

        if (!hasEmailAddressBeenEntered()) {
            onError(messages.missingEmailAddress);

            return;
        }

        if (!isEmailAddressValid()) {
            onError(messages.invalidEmailAddress);

            return;
        }

        if (consentRequired()) {
            onError(messages.consentRequired);

            return;
        }

        submit();
    });
}());
